Representative_Docs:
['Where items used in CSP_Mid.CBF require labelling, the method of marking shall be compliant with the SKA Logistic Analysis Plan. The nature of the item, its environment and its use will determine the method.', 'CSP_Mid.CBF equipment shall in accordance with ISO 61310_2 or equivalent bear all markings necessary:
for its unambiguous identification;
 for its safe use;
and supplementary information shall be given, as appropriate:
 permanently on the machinery;
 in accompanying documents such as instruction
handbooks;
 on the packaging.', 'All components and spares of the CSP_Mid.CBF, in their transport packaging, shall not be damaged while, and shall perform to specification as defined herein, after being transported under conditions as defined in “Class 2.2: careful transportation” of the ETSI EN 300 019-1-2 standard and defined in BS EN IEC 60721- 3-2:
 Climatic conditions 2K5H
 Biological conditions 2B3
 Chemical conditions 2C1
 Dust and Sand conditions 2S3
 Shock & Vibration conditions 2M3']

['Each piece of equipment shall be identified with a durable shipping tag securely attached and plainly marked with the Purchaserís order number, asset number, and tag number.', 'Unless otherwise stated in the contract or order, the cleaning, preservation, and packing of castings for shipment shall be in accordance with the manufacturer’s commercial practice. Packaging and marking shall also be adequate to identify the contents and to ensure acceptance and safe delivery by the carrier for the mode of transportation employed.', 'In accordance with ISO 61310_2, machinery shall bear all markings which are necessary 
– for its unambiguous identification;
– for its safe use;
and supplementary information shall be given, as appropriate: 
– permanently on the machinery;
– in accompanying documents such as instruction handbooks; 
– on the packaging']
